import { configureStore } from "@reduxjs/toolkit";
import authReducer from "../feautures/auth/authSlice";
import themeReducer from "../feautures/theme/themeSlice";
export const store = configureStore({
  reducer: {
    auth: authReducer,
    theme: themeReducer,
  },
});
